import React from "react";
import { useState } from "react";

function Cart({ cart, setCart }) {
  let [price, setPrice] = useState([0]);

  return (
    <article>
      {cart.map((MenuList) => {
        <div className="cart_box">
          <div className="cart_img" key={MenuList.id}>
            <img src={MenuList.img} />
            <p>
              {MenuList.name}
            </p>
          </div>
          <div>
            <button> + </button>
            <button> - </button>
          </div>
          <div>
            <span>
              {MenuList.price}
            </span>
            <button> Remove </button>
          </div>
        </div>;
      })}
      <div>
        <span>Total Cost</span>
        <span> Rs - {price}</span>
      </div>
    </article>
  );
}

export default Cart;
